import { Container, Row, Col, Button, Card } from "react-bootstrap";
function Footer() {
  return (
    <div>
      <Container>
        <center>
          <Row>
            <Col
              xs={12}
              md={3}
              style={{
                height: "40vh",
              }}
            >
              <label style={{ float: "left" }}>OUR STORY</label>
              <br />
              <label style={{ float: "left" }}>OUR STORY</label>
              <br />
              <label style={{ float: "left" }}>OUR STORY</label>
              <br />
              <label style={{ float: "left" }}>OUR STORY</label>
              <br />
            </Col>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./assets/img/10.png")',
                backgroundSize: "contain",
                height: "40vh",
              }}
            ></Col>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./assets/img/11.png")',
                backgroundSize: "contain",
                height: "40vh",
              }}
            ></Col>
            <Col
              xs={12}
              md={3}
              style={{
                backgroundImage: 'url("./assets/img/12.png")',
                backgroundSize: "contain",
                height: "40vh",
              }}
            ></Col>
          </Row>
        </center>
      </Container>
      <br />
      <br />
      <br />
      <br />
    </div>
  );
}
export default Footer;
